import{_ as p,a as g}from"./chunks/1647583375429-24557335-2b92-4ae3-9e1f-b18d161e759c.DpYBhvfh.js";import{_ as a}from"./chunks/1647583362060-8b85c2e1-bb4d-4ab0-9d2f-260279085466.C7cSb9-v.js";import{_ as i,c as d,a0 as l,j as r,a as o,G as n,w as e,B as m,o as c}from"./chunks/framework.CMtr6uOw.js";const u="/assets/1647583375504-bdb6a7ea-ead4-4f3e-9df8-ad5277c04918.CttWc8vA.png",b="/assets/1647583375579-99445bd3-70a2-4d2f-b86f-fb1d3a930ddc.Df7E1TFZ.png",f="/assets/1647583375654-4708939a-2ad5-4698-9bdf-ae25f0a3e16f.D2dXnA4K.png",h="/assets/1647583375730-311368a4-2cc5-46ab-8062-1834d57e0156.INS_8OHN.png",q="/assets/1647583375819-ed6f9565-b131-4e16-a009-3bf8551c959a.CP-r2iS0.gif",k="/assets/1647583375935-9bdf5e0e-e701-4952-97cb-bed874aecbe5.BFIpOO9p.png",_="/assets/1647583376014-e2f39351-fa8b-434c-a501-0759addbbc2d.CxBQZ03k.png",x="/assets/1647583376093-c5873fd8-193a-427d-a525-e890cbaa6ede.Dwvf16Oz.gif",P="/assets/1647583376180-12dae999-b4ea-42a0-9a24-f2af189df97a.61R22aZl.png",O=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"2-researcher-manual/1-4-data-manage-projects.md","filePath":"2-researcher-manual/1-4-data-manage-projects.md"}'),v={name:"2-researcher-manual/1-4-data-manage-projects.md"};function D(B,t,F,N,j,A){const s=m("font");return c(),d("div",null,[t[12]||(t[12]=l('<h2 id="项目数据管理" tabindex="-1">项目数据管理 <a class="header-anchor" href="#项目数据管理" aria-label="Permalink to &quot;项目数据管理 &lt;!-- {docsify-ignore-all} --&gt;&quot;">​</a></h2><p>在项目列表中点击「**下载数据」**按钮进入项目数据下载页面。</p><p>如果无法直接看<strong>画布</strong>、<strong>下载数据</strong>等按钮，可能是由于设备的屏幕过窄而无法显示完全，向右拖动滚动条即可找到。</p><p><img src="'+p+'" alt=""></p><p><img src="'+a+'" alt=""></p><p><img src="'+g+'" alt=""></p><h2 id="脑岛平台-答题赚钱-类型发布" tabindex="-1">脑岛平台（答题赚钱）类型发布 <a class="header-anchor" href="#脑岛平台-答题赚钱-类型发布" aria-label="Permalink to &quot;脑岛平台（答题赚钱）类型发布&quot;">​</a></h2><h3 id="待审核版块" tabindex="-1">待审核版块 <a class="header-anchor" href="#待审核版块" aria-label="Permalink to &quot;待审核版块&quot;">​</a></h3><h4 id="答题状态" tabindex="-1">答题状态 <a class="header-anchor" href="#答题状态" aria-label="Permalink to &quot;答题状态&quot;">​</a></h4><p>每一条数据记录的<strong>答题状态</strong>分为三种：有效、进行中和放弃 。</p><ul><li><strong>有效</strong>状态是指被试已经正常完成了项目并提交了数据。</li><li><strong>进行中</strong>状态是指被试当前正在进行项目。</li><li><strong>放弃</strong>状态是指被试在参与项目的过程中主动放弃了项目。</li></ul><p><img src="'+u+'" alt=""></p><blockquote><p>【脑岛Tips】</p><p><strong>有效</strong>的答题状态并不代表着数据质量的高低。</p><p>需要说明的是，一旦被试在测试过程中放弃测试，那么脑岛会默认<strong>拒绝</strong>该被试的数据记录。也就是说，脑岛会自动审核这些中途放弃的数据记录，因此这些中途放弃的数据记录不会出现在<strong>待审核</strong>版块，而是会自动出现在<strong>已审核</strong>版块。</p></blockquote><h4 id="数据采纳" tabindex="-1">数据采纳 <a class="header-anchor" href="#数据采纳" aria-label="Permalink to &quot;数据采纳&quot;">​</a></h4><p>当被试完成某个项目后，【下载数据】页面的<strong>待审核</strong>版块中就会出现该被试的测试记录。<strong>待审核</strong>版块中所有的测试数据都还未经过项目发布者的审核。</p><p><img src="'+b+'" alt=""></p><p>您可根据被试完成<strong>检查题</strong>的情况(可依据正确率或作答时间等指标)对被试的数据进行<strong>采纳</strong>。需要注意的是，答题状态为<strong>进行中</strong>的数据不能够进行采纳或拒绝！</p><p>被采纳的数据会出现在<strong>已审核</strong>版块中，其<strong>审核状态</strong>为_已采纳_。您可以下载已采纳的数据，也可以点击【操作】栏中的<strong>详情</strong>按钮查看被试的作答情况。</p><blockquote><p>【脑岛Tips】点击<strong>已审核</strong>版块中的【详情】按钮只能查看问卷类题目(个人信息、问卷、测试环境)的作答信息，无法查看实验的作答信息(需手动下载数据文件)。</p></blockquote><p>需要注意的是，您无法查看<strong>未采纳</strong>的被试数据，一旦您在<strong>待审核</strong>版块采纳了被试的数据，系统会默认您已经获取了被试的数据，也就意味着您不能再将被试数据的审核状态由<strong>采纳</strong>改为<strong>未采纳</strong>。</p><h4 id="数据拒绝" tabindex="-1">数据拒绝 <a class="header-anchor" href="#数据拒绝" aria-label="Permalink to &quot;数据拒绝&quot;">​</a></h4><p>如果您认为被试在测试过程中没有认真填写或存在恶意作答等情况，可以通过【拒绝】按钮不采纳被试的数据。</p><blockquote><p>【脑岛Tips】请不要随意拒绝被试的数据！如果您随意拒绝被试的数据，可能会导致被试对您所发布项目的投诉。一般来说，面对项目投诉，脑岛会先让被试和您通过<strong>站内信</strong>的方式进行私下沟通，如果沟通未果，那么脑岛平台才会介入，此时脑岛平台会根据双方提供的证据来判定被试投诉的合理性。请注意的是，如果您发布的项目收到一定数量的投诉，脑岛平台会暂时下架您的项目。</p></blockquote><p>被拒绝的数据也会出现在<strong>已审核</strong>版块，其<strong>审核状态</strong>为_未采纳_。未采纳的数据无法选中下载。</p><p><img src="'+f+'" alt=""></p><p>被拒绝的数据允许<strong>二次采纳</strong>，但这种情况一般出现在您与被试进行私下沟通有效之后。也就是说系统允许您重新采纳一开始拒绝的被试数据。注意，二次采纳后将无法拒绝该被试的数据。</p><h4 id="系统自动审核" tabindex="-1">系统自动审核 <a class="header-anchor" href="#系统自动审核" aria-label="Permalink to &quot;系统自动审核&quot;">​</a></h4><div class="danger custom-block"><p class="custom-block-title">DANGER</p><p>⚠️ 为避免接受不必要的数据，请及时进行审核。</p></div>',28)),r("p",null,[t[1]||(t[1]=o("上文所述采纳与拒绝通常需要研究者手动操作。但为保证被试权益，研究者人工手动审核的期限在作答完成的 ")),r("strong",null,[n(s,{style:{color:"#DF2A3F"}},{default:e(()=>t[0]||(t[0]=[o("72 小时内")])),_:1})]),t[2]||(t[2]=o("。"))]),r("p",null,[t[5]||(t[5]=o("如果该期限没有人工审核，将触发**")),n(s,{style:{color:"#DF2A3F"}},{default:e(()=>t[3]||(t[3]=[o("系统自动审核")])),_:1}),t[6]||(t[6]=r("strong",null,[o("，系统将根据问卷发布中设置的"),r("a",{href:"/2-researcher-manual/1-1-6-publish-project.html#验证错题数"},"检查题数量阈值"),o("来判断是否给予通过：当检查题错误数量")],-1)),t[7]||(t[7]=o("小于")),t[8]||(t[8]=r("strong",null,"该阈值，则系统将审核通过；相反若",-1)),t[9]||(t[9]=o("大于等于")),t[10]||(t[10]=r("strong",null,"该阈值则会系统拒绝。若没有设置检查题则",-1)),n(s,{style:{color:"#DF2A3F"}},{default:e(()=>t[4]||(t[4]=[o("默认系统通过")])),_:1}),t[11]||(t[11]=o("**。"))]),t[13]||(t[13]=l('<h4 id="批量采纳-拒绝" tabindex="-1">批量采纳/拒绝 <a class="header-anchor" href="#批量采纳-拒绝" aria-label="Permalink to &quot;批量采纳/拒绝&quot;">​</a></h4><p>当<strong>下载数据</strong>版块中存在不止一条作答记录时，您可以通过<strong>批量</strong>的方式进行数据的采纳和拒绝。</p><p>您可以点击<strong>全选</strong>按钮全部选中所有的作答记录，也可以通过<strong>单独勾选</strong>的方式选中您想要的作答记录。以上两种方式都会激活【批量采纳】和【批量拒绝】按钮。</p><p><img src="'+h+'" alt=""></p><p><img src="'+a+'" alt=""></p><p><img src="'+q+'" alt=""></p><h3 id="已审核版块" tabindex="-1">已审核版块 <a class="header-anchor" href="#已审核版块" aria-label="Permalink to &quot;已审核版块&quot;">​</a></h3><p>所有被审核过的数据记录都在出现在<strong>已审核</strong>版块。</p><h4 id="审核状态" tabindex="-1">审核状态 <a class="header-anchor" href="#审核状态" aria-label="Permalink to &quot;审核状态&quot;">​</a></h4><p>每一条数据记录的<strong>审核状态</strong>分为两种：<em><strong>已采纳</strong></em> 和_<strong>未采纳</strong>_。顾名思义，<strong>已采纳</strong>是指被项目发布者采纳的数据，<strong>未采纳</strong>是指被项目发布者拒绝的数据。</p><h4 id="下载所有-选中数据" tabindex="-1">下载所有/选中数据 <a class="header-anchor" href="#下载所有-选中数据" aria-label="Permalink to &quot;下载所有/选中数据&quot;">​</a></h4><p>您可以在<strong>已审核</strong>页面中下载所有审核状态为<strong>已采纳</strong>的数据。</p><blockquote><p>未采纳的数据不能下载。</p></blockquote><p>您有两种下载数据的方式可以选择：</p><ul><li>下载所有数据</li></ul><p>您可以直接点击【下载所有数据】按钮自动下载所有已采纳的数据记录。</p><p><img src="'+k+'" alt=""></p><p><img src="'+a+'" alt=""></p><p><img src="'+_+'" alt=""></p><p><strong>数据格式</strong>：您可以选择下载<code>csv文件</code>还是<code>excel文件</code></p><blockquote><p>目前仅支持下载<code>csv文件</code></p></blockquote><ul><li>下载选中数据</li></ul><p>您可以通过<strong>单独勾选</strong>的方式选中您想要的数据记录。这种方式会激活【下载选中数据】按钮。</p><p><img src="'+x+'" alt=""></p><h2 id="匿名发布" tabindex="-1">匿名发布 <a class="header-anchor" href="#匿名发布" aria-label="Permalink to &quot;匿名发布&quot;">​</a></h2><p>脑岛默认采纳所有的匿名数据，不需要您自行采纳。因此匿名数据的【下载数据】页面李没有<strong>待审核</strong>和<strong>已审核</strong>版块。</p><p>对于一个匿名项目，脑岛默认每次下载所有的匿名数据，暂不支持下载<strong>选中数据</strong>。</p><p><img src="'+P+'" alt=""></p><h2 id="其他教程" tabindex="-1">其他教程 <a class="header-anchor" href="#其他教程" aria-label="Permalink to &quot;其他教程&quot;">​</a></h2><p><a href="https://mp.weixin.qq.com/s/RVgvSqqBYg0JVzjPYyc7BA" target="_blank" rel="noreferrer">脑岛使用小妙招17丨教你轻松掌握项目发布管理和数据管理</a></p>',30))])}const S=i(v,[["render",D]]);export{O as __pageData,S as default};
